(8, 'About us', '<p>\r\n	In accounting, a brand defined as an intangible asset is often the most valuable asset on a corporation&#39;s balance sheet. Brand owners manage their brands carefully to create shareholder value, and brand valuation is an important management technique that ascribes a money value to a brand, and allows marketing investment to be managed (e.g.: prioritized across a portfolio of brands) to maximize shareholder value. Although only acquired brands appear on a company&#39;s balance sheet, the notion of putting a value on a brand forces marketing leaders to be focused on long term stewardship of the brand and managing for value.In accounting, a brand defined as an intangible asset is often the most valuable asset on a corporation&#39;s balance sheet. Brand owners manage their brands carefully to create shareholder value, and brand valuation is an important management technique that ascribes a money value to a brand, and allows marketing investment to be managed (e.g.: prioritized across a portfolio of brands) to maximize shareholder value. Although only acquired brands appear on a company&#39;s balance sheet, the notion of putting a value on a brand forces marketing leaders to be focused on long term stewardship of the brand and managing for value.</p>\r\n', 0, 'Active', 0, 1, '2015-06-06 16:06:06', '2015-09-14 13:33:31', 'Default', 'About us', 'About us', 'About us', 'about-us'),
(9, 'Privacy policy', '<p>\r\n	<span style="color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: small;">Our policies are designed to create a safe and fair environment for all eBay members. Learning what&rsquo;s allowed can help you avoid unintentionally breaking the rules and helps everyone in working with reliable, trustworthy members.</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style="font-family: Arial, Helvetica, sans-serif; font-size: small; color: rgb(51, 51, 51); margin-top: 2px; margin-bottom: 5px;">\r\n	<br />\r\n	Our guidelines are designed to encourage open and honest Feedback about your experience with a member.</p>\r\n<div>\r\n	<span style="color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: small;">Before listing an item for sale, make sure it&#39;s allowed on eBay. Get an overview of items that are prohibited or subject to restrictions, or click a link below to learn about items we&#39;re frequently asked about.</span></div>\r\n<div>\r\n	&nbsp;</div>\r\n<ul style="font-family: Arial, Helvetica, sans-serif; font-size: medium; margin: 6px 0px 0px; padding-right: 0px; padding-left: 0px; list-style-type: none; color: rgb(51, 51, 51);">\r\n	<li class="unorderedList" style="margin-bottom: 5px; margin-top: 5px; list-style-type: none; padding-left: 10px; background-image: url(http://pics.ebaystatic.com/aw/pics/help/ProStores/imgPsHelpBullet.gif); background-position: 0px 0.4em; background-repeat: no-repeat;">\r\n		<div style="font-size: small; padding-left: 4px;">\r\n			&nbsp;</div>\r\n	</li>\r\n</ul>\r\n', 0, 'Active', 0, 0, '2015-06-10 17:06:18', '2015-06-10 17:52:51', 'Default', 'privacy-policy', 'privacy-policy', 'privacy-policy', 'privacy-policy'),
(11, 'press-release', '<p>\r\n	Welcome to Whitebook General Announcements Board, where you can get the latest Whitebook news.</p>\r\n<p>\r\n	There&#39;s a lot of debate whether or not press releases are worthwhile anymore. I&#39;ve heard good arguments come from both sides, and to be perfectly honest, for most online stores it&#39;s hard to say whether the juice will be worth the squeeze.</p>\r\n', 0, 'Active', 0, 1, '2015-06-10 17:06:43', '2015-07-08 11:52:42', 'Default', 'Page meta title cannot be blank.', 'Page meta title cannot be blank.', 'Page meta title cannot be blank.', 'press-release'),
(13, 'Brands', '<p>\r\n	In accounting, a brand defined as an intangible asset is often the most valuable asset on a corporation&#39;s balance sheet. Brand owners manage their brands carefully to create shareholder value, and brand valuation is an important management technique that ascribes a money value to a brand, and allows marketing investment to be managed (e.g.: prioritized across a portfolio of brands) to maximize shareholder value. Although only acquired brands appear on a company&#39;s balance sheet, the notion of putting a value on a brand forces marketing leaders to be focused on long term stewardship of the brand and managing for value.In accounting, a brand defined as an intangible asset is often the most valuable asset on a corporation&#39;s balance sheet. Brand owners manage their brands carefully to create shareholder value, and brand valuation is an important management technique that ascribes a money value to a brand, and allows marketing investment to be managed (e.g.: prioritized across a portfolio of brands) to maximize shareholder value. Although only acquired brands appear on a company&#39;s balance sheet, the notion of putting a value on a brand forces marketing leaders to be focused on long term stewardship of the brand and managing for value.</p>\r\n', 0, 'Active', 1, 1, '2015-09-08 14:09:39', '2015-09-14 13:33:11', 'Default', 'Brands', 'Brands', 'Brands', 'brands-product'),
(14, 'Taste maker', '<p>\r\n	<strong style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans; font-size: 11px; line-height: 14px; text-align: justify;">Lorem Ipsum</strong><span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans; font-size: 11px; line-height: 14px; text-align: justify;">&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsu</span><strong style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans; font-size: 11px; line-height: 14px; text-align: justify;">Lorem Ipsum</strong><span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans; font-size: 11px; line-height: 14px; text-align: justify;">&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsu</span></p>\r\n', 0, 'Active', 0, 1, '0000-00-00 00:00:00', '2015-09-14 13:32:35', 'Default', 'Taste maker', 'Taste maker', 'Taste maker', 'taste-maker'),
(15, 'trade', '<p>\r\n	Trade involves the transfer of the ownership of goods or services from one person or entity to another in exchange for other goods or services or for money. Possible synonyms of &quot;trade&quot; include &quot;commerce&quot; and &quot;financial transaction&quot;. A network that allows trade is called a market.Trade involves the transfer of the ownership of goods or services from one person or entity to another in exchange for other goods or services or for money. Possible synonyms of &quot;trade&quot; include &quot;commerce&quot; and &quot;financial transaction&quot;. A network that allows trade is called a market.Trade involves the transfer of the ownership of goods or services from one person or entity to another in exchange for other goods or services or for money. Possible synonyms of &quot;trade&quot; include &quot;commerce&quot; and &quot;financial transaction&quot;. A network that allows trade is called a market.</p>\r\n', 0, 'Active', 0, 1, '0000-00-00 00:00:00', '2015-09-14 13:30:37', 'Default', 'Trade involves the transfer of the ownership of goods or services from one person or entity to another in exchange for other goods or services or for money. Possible synonyms of "trade" include "commerce" and "financial transaction". A network that a', 'Trade involves the transfer of the ownership of goods or services from one person or entity to another in exchange for other goods or services or for money. Possible synonyms of "trade" include "commerce" and "financial transaction". A network that a', 'Trade involves the transfer of the ownership of goods or services from one person or entity to another in exchange for other goods or services or for money. Possible synonyms of "trade" include "commerce" and "financial transaction". A network that a', 'trade-marker');
