(2, 'Vendor registration', 'Thanks for your registration ', '<p>\n	<span style="font-family:arial,helvetica,sans-serif;">Hi User,&nbsp;</span></p>\n<p>\n	<span style="font-size:12px;"><font face="arial, sans-serif"><span style="line-height: 19.2000007629395px;">Admin created your whitebook account username and password.</span></font></span></p>\n<p>\n	<span style="line-height: 19.2000007629395px; font-family: arial, sans-serif;">Once you subscribe package you have to access account.</span></p>\n<p>\n	&nbsp;</p>\n<p>\n	Thanks</p>\n', 0, 0, '2015-06-02 16:06:09', '2015-06-10 10:26:49', 'Default'),
(3, 'Vendor login', 'Whitebook package subscription is activated!', '<p>\r\n	Hi User,</p>\r\n<p>\r\n	Admin created your package subscription successfully.</p>\r\n<p>\r\n	Access your whitebook account and go ahead.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Thanks</p>\r\n', 0, 0, '2015-06-10 10:06:42', '2015-06-10 10:26:56', 'Default'),
(4, 'Vendor account deactivated', 'Your whitebook account deactivated', '<p>\n	Hi User,</p>\n<p>\n	Your whitebook account deactivated.</p>\n<p>\n	Please contact <a href="mailto:admin@whitebook.com">admin@whitebook.com</a></p>\n<p>\n	&nbsp;</p>\n<p>\n	Thanks,</p>\n<p>\n	&nbsp;</p>\n', 0, 0, '2015-06-10 10:06:06', '2015-06-10 10:27:06', 'Default'),
(5, 'Passsword recovery', 'Whitebook password recovery', '<p>\r\n	Hi User,</p>\r\n<p>\r\n	Your requested whitebook &nbsp;password.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Thanks,</p>\r\n', 0, 1, '2015-06-10 10:06:32', '2015-07-02 09:59:16', 'Default'),
