(266, 2, 61, 125, 136, 137, 'Eliot | The Harvard Crimson', 'Normal', '<p>\r\n	&ldquo;Floreat Domus de Eliot.&rdquo; You don&rsquo;t even have to know what the motto means&mdash;Let Flourish the House of Eliot&mdash;to hear the grandeur and prestige Eliot House exudes. &ldquo;In the &rsquo;30s and &rsquo;40s and &rsquo;50s it was known as an elitist House,&rdquo; said House Master Gail A. O&rsquo;Keefe, &ldquo;but that&rsquo;s long ago and far away.&rdquo; All the same, Eliot maintains an aura of preeminence that has freshmen clamoring for a spot in its hallowed halls. Once officially Eliotites, students begin to see there&rsquo;s more to the House than just the myth&mdash;they love their home not for its clout but for its community.</p>\r\n', '<p>\r\n	Rental only For maximum of 2 days</p>\r\n', 5, 5, '250', '', '<p>\r\n	&ldquo;Floreat Domus de Eliot.&rdquo; You don&rsquo;t even have to know what the motto means&mdash;Let Flourish the House of Eliot&mdash;to hear the grandeur and prestige Eliot House exudes. &ldquo;In the &rsquo;30s and &rsquo;40s and &rsquo;50s it was known as an elitist House,&rdquo; said House Master Gail A. O&rsquo;Keefe, &ldquo;but that&rsquo;s long ago and far away.&rdquo; All the same, Eliot maintains an aura of preeminence that has freshmen clamoring for a spot in its hallowed halls. Once officially Eliotites, students begin to see there&rsquo;s more to the House than just the myth&mdash;they love their home not for its clout but for its community.</p>\r\n', 'Yes', 101, 2, 1, 'No', 'Yes', 'Active', 1, 1, '2015-12-16 17:12:58', '2015-12-17 12:38:33', 'Deleted', 'eliot--the-harvard-crimson'),
